import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ProtectedRoute, AdminRoute } from './service/Guard';
import { ThemeProvider } from './context/ThemeContext';
import Header from './component/common/Header';
import Footer from './component/common/footer';
import { CartProvider } from './component/context/CartContext';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import Home from './component/pages/Home';
import ProductDetailsPage from './component/pages/ProductDetailsPage';
import CategoryListPage from './component/pages/CategoryListPage';
import CategoryProductsPage from './component/pages/CategoryProductsPage';
import CartPage from './component/pages/CartPage';
import RegisterPage from './component/pages/RegisterPage';
import LoginPage from './component/pages/LoginPage';
import ProfilePage from './component/pages/ProfilePage';
import AddressPage from './component/pages/AddressPage';
import AdminPage from './component/admin/AdminPage';
import AdminProductPage from './component/admin/AdminProductPage';
import AddProductPage from './component/admin/AddProductPage';
import EditProductPage from './component/admin/EditProductPage';
import AdminInventoryPage from './component/admin/AdminInventoryPage';
import AdminOrdersPage from './component/admin/AdminOrderPage';
import AdminOrderDetailsPage from './component/admin/AdminOrderDetailsPage';
import CheckoutPage from './component/pages/CheckoutPage';
import OrderSuccessPage from './component/pages/OrderSuccessPage';
import OrdersPage from './component/pages/OrdersPage';
import AdminUsersPage from './component/admin/AdminUsersPage';

function App() {
  return (
    <ThemeProvider>
      <CartProvider>
        <Router>
          <div className="flex flex-col min-h-screen transition-colors duration-200 dark:bg-gray-900">
            <Header />
            <main className="flex-grow container mx-auto px-4 sm:px-6 lg:px-8 pt-20">
              <Routes>
                {/* Public Routes */}
                <Route exact path='/' element={<Home/>}/>
                <Route path='/product/:productId' element={<ProductDetailsPage/>} />
                <Route path='/categories' element={<CategoryListPage/>}/>
                <Route path='/category/:categoryId' element={<CategoryProductsPage/>} />
                <Route path='/cart' element={<CartPage/>}/>
                <Route path='/register' element={<RegisterPage/>}/>
                <Route path='/login' element={<LoginPage/>}/>

                {/* Protected Routes */}
                <Route path='/profile' element={<ProtectedRoute element={<ProfilePage/>} />} />
                <Route path='/add-address' element={<ProtectedRoute element={<AddressPage/>} />} />
                <Route path='/edit-address' element={<ProtectedRoute element={<AddressPage/>} />} />
                <Route path='/checkout' element={<ProtectedRoute element={<CheckoutPage/>} />} />
                <Route path='/order-success' element={<ProtectedRoute element={<OrderSuccessPage/>} />} />
                <Route path='/orders' element={<ProtectedRoute element={<OrdersPage/>} />} />

                {/* Admin Routes */}
                <Route path='/admin' element={<ProtectedRoute element={<AdminPage/>} adminOnly={true} />} />
                <Route path='/admin/products' element={<ProtectedRoute element={<AdminProductPage/>} adminOnly={true} />} />
                <Route path='/admin/add-product' element={<ProtectedRoute element={<AddProductPage/>} adminOnly={true} />} />
                <Route path='/admin/edit-product/:productId' element={<ProtectedRoute element={<EditProductPage/>} adminOnly={true} />} />
                <Route path='/admin/inventory' element={<ProtectedRoute element={<AdminInventoryPage/>} adminOnly={true} />} />
                <Route path='/admin/orders' element={<ProtectedRoute element={<AdminOrdersPage/>} adminOnly={true} />} />
                <Route path='/admin/order-details/:itemId' element={<ProtectedRoute element={<AdminOrderDetailsPage/>} adminOnly={true} />} />
                <Route path='/admin/users' element={<ProtectedRoute element={<AdminUsersPage/>} adminOnly={true} />} />
              </Routes>
            </main>
            <Footer />
            <ToastContainer
              position="bottom-right"
              autoClose={3000}
              hideProgressBar={false}
              newestOnTop
              closeOnClick
              rtl={false}
              pauseOnFocusLoss
              draggable
              pauseOnHover
              theme="colored"
            />
          </div>
        </Router>
      </CartProvider>
    </ThemeProvider>
  );
}

export default App;
